                        classNameName={`nav-link ${pathname.includes("Search") ? "active" : ""}`}>Search</Link>
                  <Link to="/Profile"
                        classNameName={`nav-link ${pathname.includes("Profile") ? "active" : ""}`}>Profile</Link>
                  <Link to="/Login"
                        classNameName={`nav-link ${pathname.includes("Login") ? "active" : ""}`}>Login</Link>
                  <Link to="/Details"
                        classNameName={`nav-link ${pathname.includes("Details") ? "active" : ""}`}>Details</Link>
            </nav>
      );
}


